import React from "react";

import "./planetParams.scss";

const PlanetParams = () => {
  return (
    <div className="planetParams">
      <div className="planetParams__title">
        <span>Q1 2022</span>
        <div className="planetParams__title -outer">
          <div className="planetParams__title -inner"></div>
        </div>
      </div>
    </div>
  );
};

export default PlanetParams;
